  true,\n\t\"url\": null,\n\t\"notes\": \"The data asset provides a link to all Direct
  Deposit Applications filed via the Internet datasets. Each dataset provides monthly
  volumes at the national level from federal fiscal year 2008 onwards for Internet
  Direct Deposit applications. The dataset includes only Internet Direct Deposit transactions.
  It should be noted that, in addition to using our online Direct Deposit application,
  the public might also call our 800 number, visit a field office,  or request a change
  of direct deposit by mail.  This data set pertains only to the online alternative.\",\n\t\"license_title\":
